<h2><a href="http://sp4trzebinia.superszkolna.pl/wiadomosci/1/wiadomosc/323892/podsumowanie_kiermaszu_wielkanocnego">PODSUMOWANIE KIERMASZU WIELKANOCNEGO</a></h2>
<p>W dniach 11 i 12 kwietnia w naszej szkole odbyl sie Kiermasz Wielkanocny. W tych dniach w szkolnym holu zrobilo sie wiosennie, kolorowo i swiatecznie. Uczniowie i rodzice wykonali piekne wielkanocne ozdoby, kt&oacute;re mozna bylo podziwiac i zakupic.Rekodzielnicze dziela: stroiki, pisanki,...</p>
